import React from "react";
import { BrowserRouter as Routers, Route, Routes} from 'react-router-dom';

import Personalized_data_dispenser from "./Personalized_data_dispenser";

const Personalized_data_progresser = (props) => {

    switch(typeof props.id){

        case (`object`): return <React.Fragment>
            <Routers>

            <Routes>
            <Route path="/account" element={<Personalized_data_dispenser/>}>My Account</Route>
            <Route path="/reviews" element={<Personalized_data_dispenser/>}>My reviews</Route>
            <Route path="/journal" element={<Personalized_data_dispenser/>}>My journal</Route>
            <Route path="/alarms" element={<Personalized_data_dispenser/>}>Alarms</Route>
            <Route path="/filter" element={<Personalized_data_dispenser/>}>Filter</Route>
            </Routes>

            </Routers>

        </React.Fragment>


    }

}

export default Personalized_data_progresser;
